case 50:
{      yyval.claim = makeClaimNode (yyvsp[-11].ltok, yyvsp[-9].paramlist, yyvsp[-7].globals, yyvsp[-4].letdecls, yyvsp[-3].lclpredicate, yyvsp[-2].program, yyvsp[-1].lclpredicate); 
     symtable_exitScope (g_symtab); ;
    break;}
case 51:
{ yyval.claim = (claimNode) 0; ;
    break;}
