{g_inTypeDef = TRUE; ;
    break;}
case 53:
{g_inTypeDef = FALSE; ;
    break;}
case 54:
{ yyval.abstract = makeAbstractNode (yyvsp[-5].ltok, yyvsp[-2].ltok, TRUE, FALSE, yyvsp[0].abstbody); ;
    break;}
